import React, { useEffect } from "react";
import "../css_styles/Tourisms.css";
import Reseller from "../components/Reseller";
import Footers from "../components/Footers";
import Banners from "../components/Banners";
import Categories from "../components/Categories";
import CelebCarousel from "../components/CelebCarousel";

import { useSelector, useDispatch } from "react-redux";

import { resellerListAction } from "../actions/advertiseActions2";

const celeb = {
  title: "title",
  urlToImage:
    "https://staticg.sportskeeda.com/editor/2021/11/caca5-16370851386444-1920.jpg",
  description: "description",
  author: "author",
  content: "content",
};
const ResellerScreen = () => {
  const dispatch = useDispatch();
  const resellerList = useSelector((state) => state.resellerList);

  const {
    error: listResellerError,
    loading: listResellerLoading,
    resellers: listResellers,
  } = resellerList;

  useEffect(() => {
    dispatch(resellerListAction());
  }, [dispatch]);

  return (
    <div>
      <CelebCarousel celeb={celeb} />
      <Banners />
      <Categories />
      <div className="tourist_screen">
        <div className="tourist_event">Hi</div>
        <div className="tourist_main">
          {listResellers.map((reseller) => (
            <Reseller key={reseller.id} reseller={reseller} />
          ))}
        </div>
        <div className="tourist_event">Hi</div>
      </div>
      <Footers />
    </div>
  );
};

export default ResellerScreen;
